		"text": "서울 아트 시네마가 2018년에 성추행 혐의를 인정하고 스스로 사임한 김성욱 프로그램디렉터를 2019년에 재임용했음. 그리고 서울 아트 시네마는 2020년 서울 국제 여성 영화제가 열리는 영화관들 중 하나인 것. 이 이야기인가보다"
