		"full_text": "봇에서 이 방식으로 자동 리트윗을 썼기 때문에 이것도 이제 안 됨. 관련 기관이나 단체에섯 채용, 공모 정보와 관련된 트윗을 작성하면 자동 리트윗을 했으나 이것도 이제 안 됨. 대안으로 from:단체계정 \"키워드\"를 쓰면 되지만 이것은 길어지면 작동을 안한다. 기준도 모호함. 단체가 수십개면?",
