		"full_text": "예를들어,\n\n1. 방송사, 음악방송에서 좋아하는 아티스트와 관련된 정보만 보거나\n2. 티켓 오픈 정보만 하나의 채널에 올려서 보거나 티켓 오픈 정보 중 내가 좋아하는 아티스트 정보만 보거나\n3. 뉴스, 정부 기관에서 코로나19 관련된 정보를 보거나\n\n이런 것이 서드파티에서 할 수 없음.",
