		"text": "행동강령의 중요성은 재귀적입니다. 행동강령 준수를 위해 노력하는 사람들을 보호하기 위해서라도 행동강령이 필요합니다. 단체가 반드시 어떤 선택을 내려야하는 순간에 개인에게 책임을 전가해 회피하려 하지 않고, 단체로 마주해 문제를 해결하려면 행동강령이 반드시 필요합니다."
